import React from "react";
import Navbar from "./navbar";
import Welcome from "./welcome";

class MainPage extends React.Component {
   handleContinue1 = () => {
      this.props.onContinue1();
   };

   render() {
      return (
         <>
            <Navbar />
            <div className="App">
               <Welcome onContinue={this.handleContinue1} />
            </div>
         </>
      );
   }
}

export default MainPage;
